guages;const Bj={about:"About",projects:"Projects",contact:"Contact",language:"Language"},Uj={info:"Information",link1:"About",link2:"Projects",link3:"Certificates",link4:"Experience",link5:"Tech Content",tec:"Technologies"},Wj={title:"My name is",text1:"I am",text2:"Developer",text3:"I transform ideas into digital experiences! I develop modern websites and applications, with optimized and engaging interfaces."},Hj=JSON.parse(`{"title":"See some of my projects","link":"See more projects","reactNative":{"futuroGarantido":{"title":"Guaranteed Future","description":"The 'Guaranteed Future' project is a tool designed to assist students. Developed using React Native, this intuitive and simple application facilitates efficient time management for users, helping them in their academic studies. Available for download on the Google Play Store, 'Futuro Garantido' is a testament to the proactive assistance it provides in the daily lives of students."},"dualGame":{"title":"Games for Two","description":"'Fun for Two' is my first project developed from scratch using React Native. Designed as a lightweight and user-friendly gaming platform, it provides fun games for friends to play together. With a focus on simplicity, the application is available on the Google Play Store, marking my first independent application of my development skills and learnings with React Native."},"PomodoroPrimeTimer":{"title":"Pomodoro Prime Timer","description":"The Pomodoro Prime Timer project was created with the intention of helping people learn and improve their productivity. It is a simple and intuitive application that allows users to set a timer for their tasks, helping them focus and manage their time more efficiently. The project was developed using React Native and is available for download on the Google Play Store."},"RegistroTreinamento":{"title":"Training Record","description":"The 'MChiodi - Training Record' project is a tool designed to assist athletes. Developed using React Native, this intuitive and simple application facilitates efficient time management for users, helping them in their training. Available for download on the Google Play Store, 'MChiodi - Training Record' is a testament to the proactive assistance athletes have in their daily lives."},"GerenciadorCartoes":{"title":"Card Manager","description":"Card Manager is an innovative application designed for efficient personal finance management, now completely offline. It offers instant expense tracking, easy credit and debit card management, and intelligent statistical analysis for financial decision making. Ensuring data security, the application operates 100% offline. Available on the PlayStore, Card Manager is developed using React Native."},"PortfolioMobile":{"title":"Portfolio Mobile","description":"This project is the result of the skills and knowledge acquired during the 'React Native Developer Training' program. Designed to demonstrate the practical application of React Native in mobile application development, this project covers three main screens: Home, Timeline, and Projects."},"Bibliotrack":{"title":"Bibliotrack","description":"Meet Bibliotrack: Your reading app built on React Native. With it, you can easily manage your personal library, add new books, save inspirational quotes, set reading goals and track your progress, all in one place. Simplify and enhance your reading experience with Bibliotrack."},"FitForge":{"title":"FitForge","description":"FitForge is a fitness app built on React Native. It allows you to easily log your daily workouts, track your water intake, use a built-in timer for high-intensity intervals or rest time between sets, view your workout history to track your progress, export your workout data for analysis or sharing and create custom workout routines. Define which muscles to train each day and let the app guide you through each workout."},"DailyDone":{"title":"DailyDone","description":"DailyDone: organize your tasks without relying on the internet and simplify your routine. Record appointments, mark accomplishments and delete unnecessary tasks, keeping focus on what matters. Access everything in one place, offline and reliably. Gain control and productivity with DailyDone!"}},"reactJS":{"windows":{"title":"Windows Project","description":"This educational project was designed using ReactJS to explore various language techniques. The goal was to create components that resemble the Windows system using custom code, without relying on ready-made APIs. Each component was designed to enhance understanding and proficiency in ReactJS, providing a rich learning experience while experimenting with various coding approaches within the framework."},"projectShop":{"title":"Shop Project","description":"Welcome to our Online Marketplace for Electronics Projects! Developed with ReactJS for educational purposes, this platform simulates e-commerce experiences, providing hands-on learning in buying and selling electronics projects. Engage with this interactive tool to apply key web development concepts and technologies, enhancing your understanding and skills in e-commerce."},"ProjetoJogoVelha":{"title":"Tic Tac Toe","description":"The game Tic Tac Toe project, developed using ReactJS, provides an engaging and interactive gaming experience for study and entertainment purposes. Users can enjoy exciting matches with friends or online players through a user-friendly website. It features player name customization, a scoring system, and a sleek interface, serving as a fun tool for entertainment and a valuable resource for studying ReactJS."},"NLWSpacetime":{"title":"NLW Spacetime","description":"During this inspiring event, I had the opportunity to participate and delve into the creation of a memory recall application using powerful technologies such as ReactJS, React Native, NextJS, among others. Over the course of five intense days, the Rocketseat team provided valuable lessons, opening the door to a world of possibilities and learning."},"RegistroTreinamento":{"title":"Training Record","description":"The 'Training Record Web Version' project was meticulously developed using the ReactJS library, offering a fluid and responsive web experience for its users. It is worth mentioning that this system was inspired and based on another project called 'MChiodi - Training Record', which was originally developed using React Native technology."},"NovoSpotifyBeta":{"title":"New Spotify beta","description":"This project was developed using ReactJS and TailwindCSS, offering a fluid and responsive web experience for its users. It was inspired by the Spotify platform and offers a rich experience for music lovers. Serving as a fun tool for entertainment and a valuable resource for studying ReactJS."},"AjudaLink":{"title":"Help with Link","description":"'Help with Link' is an innovative resource designed to support beginning programmers. This project brings together a carefully curated collection of links, chosen through artificial intelligence, to provide an effective and intuitive learning path into the world of programming"},"ShopSupplements":{"title":"Shop Supplements","description":"Shop Supplements is a basic layout for supplement stores, designed to showcase different visual options in a modern, responsive and interactive way. With product carousels, 3D effects and smooth animations, it provides an engaging and professional experience. Created by MChiodi, the design combines usability and strong visual identity, allowing customers to explore and choose the best style for their business."},"ExpressoDesign":{"title":"Expresso Design","description":"Expresso Design is a project developed with ReactJS to demonstrate the practical application of responsive and interactive design concepts. With a modern and elegant interface, it offers an attractive and engaging user experience. This project is a demonstration of MChiodi's commitment to excellence and innovation, combining technical and creative skills to create high-quality design solutions."},"FlagCustomizer":{"title":"Flag Customizer","description":"Personalize your photos with stylish flag overlays in round or square format, adding custom text and personalized colors. Ideal for campaigns, social media, or any visual content where you want to express your identity or brand."},"MChiodiTools":{"title":"MChiodi Tools","description":"MChiodi Tools is a collection of useful tools for developers, designed to facilitate and optimize daily tasks. With a focus on practicality and efficiency, this project offers a variety of functionalities that can be easily integrated into any development workflow."}},"NodeJS":{"QRCodesGenerator":{"title":"QR Code Generator for E-commerce","description":"This system, developed with NodeJS, allows users to easily create QR Codes for URLs, texts, images and other data, offering several options for customization, such as size, color and format."},"PodcastsManager":{"title":"PodcastsManager","description":"Project developed in NodeJS to organize and manage podcasts. Includes Episode Listing, Episode Editing, Episode Deletion and filter by name, with scalability and security"},"CryptoApi":{"title":"CryptoApi","description":"Crypto API is a Node.js REST API that provides real-time data about cryptocurrencies, including prices, market history, currency conversions, and custom alerts. With endpoints for price tracking, favorites, and dollar quotes, the API is ideal for applications that need up-to-date information about the crypto market."},"TaskManager":{"title":"Task Manager","description":"This project is a task management system that allows users to register, list, edit and delete tasks. The system consists of a frontend developed in React.js with Tailwind CSS and a backend using Node.js with Express and Sequelize for communication with the database."},"URLShortener":{"title":"URL Shortener","description":"This project is a complete URL shortener that transforms long links into short and easily shareable versions. Divided into two parts, the system has a robust backend, developed in Node.js with Express, which shortens URLs, automatically generates QR Codes and manages redirection to the original links. On the frontend, I used React, Tailwind CSS and Framer Motion to create a modern, interactive and responsive interface, enriched with dynamic animations."}},"HTMLCSSJavaScript":{"TCCParqueVivo":{"title":"TCC Parque Vivo","description":"Developed for TIIEM at IFSP - Campus Araraquara, this final project supports the non-profit organization 'Parque Vivo', integrating basic and technical knowledge acquired during the course. Using HTML, CSS, MySQL, PHP, Ajax and JavaScript, it reflects our learning journey and practical skills. It is a practical demonstration of the comprehensive understanding and application of these technologies, showing the perfect integration between theory and practice."}},"VScodeExtensions":{"hydration-reminder":{"title":"Hydration Reminder","description":"Hydration Reminder is a Visual Studio Code extension that helps developers stay hydrated during long coding sessions. It sends regular reminders to drink water, promoting healthy habits and increasing productivity."},"Snake-in-VSCode":{"title":"Snake in VSCode","description":"Snake in VSCode is a fun and interactive game that brings the classic snake experience to the Visual Studio Code environment. Developed as an extension, it allows users to play while coding, providing a fun and relaxing break from work."}}}`),Kj={title:"All Projects ",back:"Back",select:"Choose technology",all:"All"},Gj={link:"Learn more"},Yj={link:"View project"},qj={title:"Certificates",subtitle:"Here are some of my certificates from courses and training."},Jj={title:"My Journey",subtitle:"See my professional and academic trajectory.",ifsp:{title:"IFSP - Araraquara",text1:"During my years of study at the Instituto Federal de Araraquara, I completed a technical course integrated with high school, which lasted four years. It was during this period that I had my first exposure and learned programming languages, including HTML, CSS, PHP, SQL, JavaScript, AJAX and jQuery.",text2:"This course provided me with a solid foundation of basic and technological knowledge. As part of the completion of my course, I developed a special project. The main objective of this project was to integrate and apply the knowledge acquired throughout my education. I chose to create an initiative focused on the non-profit organization 'Parque Vivo'. In this project, I was able to combine my technical and academic learnings, contributing significantly to a relevant and beneficial cause for the community. This experience not only solidified my knowledge, but also allowed me to witness first-hand the practical possibilities of applying technology to impactful social projects."},job:{title:"First Job",text1:"As I embark on the journey of my first job as a Fullstack Developer, I realize that every line of code I write is infused with effort, continuous learning, and commitment to excellence. My responsibilities are heavy; they involve the creation of vital institutional websites, the development of crucial systems for file management, and the implementation of platforms that strictly comply with the LGPD.",text2:"This position requires not only refined technical skills in languages such as CodeIgniter, JavaScript, SQL, PHP, HTML5, and CSS, but also a deep operational understanding of the practical issues faced by end users. I am the one who optimizes and keeps websites running smoothly, and I am the one who intervenes when unexpected bugs arise, working diligently to resolve each issue and ensure a perfect user experience."},courses:{title:"Extra Courses",text1:"Upon completing my studies at the Federal Institute, I embraced the perpetual and captivating journey of learning. With dedicated effort, I participated in several courses offered by platforms such as Dio, significantly sharpening and expanding my skills.",text2:"Currently, my focus is on improving my proficiency in React Js and React Native. This continuous investment in self-knowledge and improvement goes beyond acquiring technical skills. It is about fostering a resilient and innovative mindset capable of navigating and overcoming the challenges presented by the dynamic and constantly evolving professional scenario of which I am a part."},MChiodi:{title:"Creation of MChiodi",text1:"When I started studying React Native, I had no idea how much it would impact my life. With dedication and a passion for development, I created MChiodi  a developer account that now features over 7 published apps, as well as a YouTube channel focused on programming content!",text2:"But the most incredible part of this journey wasn't just building apps  it was the opportunities that came along the way. Through this project, I had the honor of speaking at several schools, sharing my experience and encouraging students to believe in the power of learning and technology."}},Qj={video1:{title:"From Developer to Content Creator",description:"In this video, I share my journey from being a developer to becoming a content creator. I talk about the challenges and lessons Ive learned along the way and how it helped me grow professionally. If you're thinking about taking this path, this video is for you!"},video2:{title:"Lynx: A New Threat to React Native and Flutter?",description:"In this video, we discuss Lynx, a new programming language that promises to revolutionize mobile app development. We'll explore its features, advantages, and how it compares to React Native and Flutter. If you're a developer or interested in tech, dont miss it!"},video3:{title:"You're Not a Real Front-End Dev If You Don't Know These 6 Libraries!",description:"In this video, I present 6 essential libraries that every front-end developer should know. Each one offers amazing features that can simplify and speed up your work. If you want to stand out in the field, make sure to check them out!"}},Xj={title:"Tech Content",text:"Here are some videos and content productions that I publish on my channel and social networks!",link:"See more on the channel "},Zj={navbar:Bj,footer:Uj,about:Wj,projects:Hj,AllProjects:Kj,ProjectCard:Gj,Modal:Yj,certificates:qj,experience:Jj,youtubeVideos:Qj,YoutubeSection:Xj},eR={about:"Sobre",projects:"Projetos",contact:"Contato",language:"Idioma"},tR={info:"Informaes",link1:"Sobre",link2:"Projetos",link3:"Certificados",link4:"Experincia",link5:"Contedo Tech",tec:"Tecnologias"},nR={title:"Meu nome ",text1:"Sou",text2:"Desenvolvedor",text3:"transformo ideias em experincias digitais! Desenvolvo sites e aplicativos modernos, com interfaces otimizadas e envolventes."},rR=JSON.parse(`{"title":"Conhea alguns de meus projetos","link":"Ver mais projetos","reactNative":{"futuroGarantido":{"title":"Futuro Garantido","description":"O projeto 'Futuro Garantido'  uma ferramenta projetada para auxiliar estudantes. Desenvolvido usando React Native, este aplicativo intuitivo e simples facilita o gerenciamento eficiente do tempo para os usurios, ajudando-os em seus estudos acadmicos. Disponvel para download no Google Play Store, 'Futuro Garantido'  um testemunho do auxlio proativo no dia a dia dos estudantes."},"dualGame":{"title":"Jogos para Dois","description":"'Diverso em Dupla'  meu primeiro projeto desenvolvido do zero utilizando React Native. Projetado como uma plataforma de jogos leve e amigvel, ele proporciona jogos divertidos para amigos jogarem juntos. Com foco na simplicidade, o aplicativo est disponvel no Google Play Store, marcando minha primeira aplicao independente das habilidades e aprendizados de desenvolvimento com React Native."},"PomodoroPrimeTimer":{"title":"Pomodoro Prime Timer","description":"O projeto Pomodoro Prime Timer foi criado com a inteno de ajudar as pessoas a aprenderem e melhorarem sua produtividade.  um aplicativo simples e intuitivo que permite aos usurios definir um temporizador para suas tarefas, ajudando-os a se concentrar e gerenciar seu tempo de forma mais eficiente. O projeto foi desenvolvido usando React Native e est disponvel para download no Google Play Store."},"RegistroTreinamento":{"title":"Registro de treinamento","description":"O projeto 'MChiodi - Training Record'  uma ferramenta projetada para auxiliar atletas. Desenvolvido usando React Native, este aplicativo intuitivo e simples facilita o gerenciamento eficiente do tempo para os usurios, ajudando-os em seus treinos. Disponvel para download no Google Play Store, 'MChiodi - Training Record'  um testemunho do auxlio proativo no dia a dia dos atletas."},"GerenciadorCartoes":{"title":"Gerenciador de cartes","description":"Gerenciador de cartes  um aplicativo inovador projetado para gerenciamento eficiente de finanas pessoais, agora totalmente offline. Ele oferece rastreamento instantneo de gastos, gerenciamento fcil de cartes de crdito e dbito e anlise estatstica inteligente para tomada de decises financeiras. Garantindo a segurana dos dados, o aplicativo opera 100% offline. Disponvel no PlayStore, Card Manager  desenvolvido usando React Native."},"PortfolioMobile":{"title":"Portfolio Mobile","description":"Este projeto  o resultado das habilidades e conhecimentos adquiridos durante o programa 'Formao React Native Developer'. Projetado para demonstrar a aplicao prtica do React Native no desenvolvimento de aplicaes mveis, este projeto abrange trs telas principais: Home, Timeline e Projects."},"Bibliotrack":{"title":"Bibliotrack","description":"Conhea o Bibliotrack: Seu aplicativo de leitura desenvolvido em React Native. Com ele, voc pode gerenciar sua biblioteca pessoal com facilidade, adicionar novos livros, salvar citaes inspiradoras, estabelecer metas de leitura e acompanhar seu progresso, tudo em um nico lugar. Simplifique e aprimore sua experincia como leitor com o Bibliotrack."},"FitForge":{"title":"FitForge","description":"FitForge  um aplicativo de fitness desenvolvido em React Native. Ele permite que voc registre seus treinos dirios com facilidade, acompanhe sua ingesto de gua, use um timer integrado para intervalos de alta intensidade ou tempo de descanso entre as sries, visualize seu histrico de treinos para acompanhar seu progresso, exporte seus dados de treino para anlise ou compartilhamento e crie rotinas de treino personalizadas. Defina quais msculos sero treinados a cada dia e deixe o aplicativo gui-lo durante cada treino."},"DailyDone":{"title":"DailyDone","description":"DailyDone: organize suas tarefas sem depender de internet e simplifique sua rotina. Registre compromissos, marque realizaes e exclua o desnecessrio, mantendo foco no que importa. Acesse tudo em um s lugar, offline e de forma confivel. Ganhe controle e produtividade com o DailyDone!"}},"reactJS":{"windows":{"title":"Projeto Windows","description":"Este projeto educacional foi elaborado usando ReactJS para explorar vrias tcnicas de linguagem. O objetivo era criar componentes que se assemelhassem ao sistema Windows usando cdigo personalizado, sem depender de APIs prontas. Cada componente foi projetado para aprimorar o entendimento e a proficincia em ReactJS, oferecendo uma rica experincia de aprendizado enquanto se experimenta diversas abordagens de codificao dentro do framework."},"projectShop":{"title":"Projeto Loja","description":"Bem-vindo ao nosso Mercado Online para Projetos Eletrnicos! Desenvolvida com ReactJS para fins educacionais, esta plataforma simula experincias de e-commerce, proporcionando aprendizado prtico na compra e venda de projetos eletrnicos. Engaje-se com esta ferramenta interativa para aplicar conceitos e tecnologias-chave de desenvolvimento web, aprimorando seu entendimento e habilidades no comrcio online de projetos eletrnicos."},"ProjetoJogoVelha":{"title":"Projeto Jogo da Velha","description":"O projeto Jogo da Velha, desenvolvido utilizando ReactJS, proporciona uma experincia de jogo envolvente e interativa para fins de estudo e entretenimento. Os usurios podem desfrutar de partidas empolgantes com amigos ou jogadores online por meio de um site amigvel. Ele possui personalizao de nome de jogador, sistema de pontuao e uma interface elegante, servindo como uma ferramenta divertida para entretenimento e um recurso valioso para o estudo do ReactJS."},"NLWSpacetime":{"title":"NLW Spacetime","description":"Durante este evento inspirador, tive a oportunidade de participar e me aprofundar na criao de um aplicativo de recordao de memrias usando tecnologias poderosas como ReactJS, React Native, NextJS, dentre outras. Ao longo de cinco dias intensos, a equipe Rocketseat ofereceu lies valiosas, abrindo as portas para um mundo de possibilidades e aprendizado."},"RegistroTreinamento":{"title":"Registro de treinamento","description":"O projeto 'Registro de treinamento verso web' foi meticulosamente desenvolvido usando a biblioteca ReactJS, oferecendo uma experincia web fluida e responsiva para seus usurios. Vale ressaltar que este sistema foi inspirado e baseado em outro projeto chamado 'MChiodi - Training Record', que foi originalmente desenvolvido usando a tecnologia React Native."},"NovoSpotifyBeta":{"title":"Novo Spotify beta","description":"Este projeto foi desenvolvido usando ReactJS e TailwindCSS, oferecendo uma experincia web fluida e responsiva para seus usurios. Ele foi inspirado na plataforma Spotify e oferece uma rica experincia para os amantes da msica. Servindo como uma ferramenta divertida para entretenimento e um recurso valioso para o estudo do ReactJS."},"AjudaLink":{"title":"Ajuda com link","description":"'Ajuda com Link'  um recurso inovador desenhado para apoiar programadores iniciantes. Este projeto rene uma coleo cuidadosamente curada de links, escolhidos atravs de inteligncia artificial, para fornecer um caminho de aprendizado eficaz e intuitivo no mundo da programao"},"ShopSupplements":{"title":"Shop Supplements","description":"Shop Supplements  um layout base para lojas de suplementos, projetado para demonstrar diferentes opes visuais de forma moderna, responsiva e interativa. Com carrossis de produtos, efeitos 3D e animaes suaves, ele proporciona uma experincia envolvente e profissional. Criado por MChiodi, o design combina usabilidade e identidade visual forte, permitindo que clientes explorem e escolham o melhor estilo para seus negcios."},"ExpressoDesign":{"title":"Expresso Design","description":"Expresso Design  um projeto desenvolvido com ReactJS para demonstrar a aplicao prtica de conceitos de design responsivo e interativo. Com uma interface moderna e elegante, ele oferece uma experincia de usurio atraente e envolvente. Este projeto  uma demonstrao do compromisso de MChiodi com a excelncia e a inovao, combinando habilidades tcnicas e criativas para criar solues de design de alta qualidade."},"FlagCustomizer":{"title":"Flag Customizer","description":"Personalize suas fotos com sobreposies de bandeiras estilosas em formato redondo ou quadrado, adicionando texto e cores personalizados. Ideal para campanhas, redes sociais ou qualquer contedo visual que expresse sua identidade ou marca."},"MChiodiTools":{"title":"MChiodi Tools","description":"MChiodi Tools  um projeto desenvolvido com ReactJS que oferece uma coleo de ferramentas teis para desenvolvedores e entusiastas de tecnologia. Com uma interface intuitiva e responsiva, ele permite acesso fcil a diversas funcionalidades, como converso de unidades, gerador de senhas seguras e muito mais. Este projeto reflete o compromisso de MChiodi em fornecer solues prticas e eficientes para a comunidade de tecnologia."}},"NodeJS":{"QRCodesGenerator":{"title":"Gerador de QR Codes","description":"Este sistema, desenvolvido com NodeJS, permite aos usurios criar QR Codes para URLs, textos, imagens e outros dados com facilidade, oferecendo diversas opes para personalizao, como tamanho, cor e formato."},"PodcastsManager":{"title":"Gerenciador de Podcasts","description":"Projeto desenvolvido em NodeJS para organizar e gerenciar podcasts. Inclui Listagem de Episdios, Edio de Episdios, Excluso de Episdios e filtro por nome, com escalabilidade e segurana"},"CryptoApi":{"title":"CryptoApi","description":"Crypto API  uma API REST em Node.js que fornece dados em tempo real sobre criptomoedas, incluindo preos, histrico de mercado, converso de moedas e alertas personalizados. Com endpoints para rastreamento de preos, favoritos e cotao do dlar, a API  ideal para aplicaes que necessitam de informaes atualizadas sobre o mercado cripto."},"TaskManager":{"title":"Gerenciador de Tarefas","description":"Este projeto  um sistema de gerenciamento de tarefas que permite aos usurios registrar, listar, editar e excluir tarefas. O sistema consiste em um frontend desenvolvido em React.js com Tailwind CSS e um backend usando Node.js com Express e Sequelize para comunicao com o banco de dados."},"URLShortener":{"title":"URL Shortener","description":"Este projeto  um encurtador de URLs completo que transforma links extensos em verses curtas e facilmente compartilhveis. Dividido em duas partes, o sistema conta com um backend robusto, desenvolvido em Node.js com Express, que realiza o encurtamento das URLs, gera QR Codes automaticamente e gerencia o redirecionamento para os links originais. No frontend, utilizei React, Tailwind CSS e Framer Motion para criar uma interface moderna, interativa e responsiva, enriquecida com animaes dinmicas."}},"HTMLCSSJavaScript":{"TCCParqueVivo":{"title":"TCC Parque Vivo","description":"Desenvolvido para o TIIEM no IFSP - Campus Araraquara, este projeto final apoia a organizao sem fins lucrativos 'Parque Vivo', integrando conhecimentos bsicos e tcnicos adquiridos durante o curso. Utilizando HTML, CSS, MySQL, PHP, Ajax e JavaScript, ele reflete nossa jornada de aprendizado e habilidades prticas.  uma demonstrao prtica da compreenso e aplicao abrangentes dessas tecnologias, mostrando a integrao perfeita entre teoria e prtica."}},"VScodeExtensions":{"hydration-reminder":{"title":"Hydration Reminder","description":"O Hydration Reminder  uma extenso do Visual Studio Code que ajuda os desenvolvedores a se manterem hidratados durante longas sesses de codificao. Ele envia lembretes regulares para beber gua, promovendo hbitos saudveis e aumentando a produtividade."},"Snake-in-VSCode":{"title":"Snake in VSCode","description":"O Snake in VSCode  um jogo divertido e interativo que traz a clssica experincia do jogo da cobrinha para o ambiente do Visual Studio Code. Desenvolvido como uma extenso, ele permite que os usurios joguem enquanto codificam, proporcionando uma pausa divertida e relaxante durante o trabalho."}}}`),iR={title:"Todos os Projetos ",back:"Voltar",select:"Escolha a tecnologia",all:"Todas"},oR={link:"Saber mais"},sR={link:"Ver projeto"},aR={title:"Certificados",subtitle:"Aqui esto alguns dos meus certificados de cursos e treinamentos."},lR={title:"Minha Jornada",subtitle:"Veja minha trajetria profissional e acadmica.",ifsp:{title:"IFSP - Araraquara",text1:"Durante meus anos de estudo no Instituto Federal de Araraquara, conclu um curso tcnico integrado ao ensino mdio, que durou quatro anos. Foi durante esse perodo que tive minha primeira exposio e aprendi linguagens de programao, incluindo HTML, CSS, PHP, SQL, JavaScript, AJAX e jQuery.",text2:"Este curso me proporcionou uma base slida de conhecimentos bsicos e tecnolgicos. Como parte da concluso do meu curso, desenvolvi um projeto especial. O objetivo principal deste projeto era integrar e aplicar os conhecimentos adquiridos ao longo da minha educao. Escolhi criar uma iniciativa voltada para a organizao sem fins lucrativos 'Parque Vivo'. Neste projeto, consegui combinar meus aprendizados tcnicos e acadmicos, contribuindo significativamente para uma causa relevante e benfica para a comunidade. Essa experincia no apenas solidificou meu conhecimento, mas tambm me permitiu testemunhar em primeira mo as possibilidades prticas de aplicar a tecnologia a projetos sociais impactantes."},job:{title:"Primeiro Emprego",text1:"Ao embarcar na jornada do meu primeiro emprego como Desenvolvedor Fullstack, percebo que cada linha de cdigo que escrevo est impregnada de esforo, aprendizado contnuo e compromisso com a excelncia. Minhas responsabilidades so pesadas; eles envolvem a criao de sites institucionais vitais, o desenvolvimento de sistemas cruciais para o gerenciamento de arquivos e a implementao de plataformas que cumprem rigorosamente a LGPD.",text2:"Esta posio exige no apenas habilidade tcnica refinada em linguagens como CodeIgniter, JavaScript, SQL, PHP, HTML5 e CSS, mas tambm uma compreenso operacional profunda das questes prticas enfrentadas pelos usurios finais. Sou eu quem otimiza e mantm sites funcionando perfeitamente, e sou o interventor quando surgem bugs inesperados, trabalhando diligentemente para resolver cada problema e garantir uma experincia perfeita para o usurio."},courses:{title:"Cursos Extras",text1:"Ao concluir meus estudos no Instituto Federal, abracei a jornada perptua e cativante do aprendizado. Com esforo dedicado, participei de vrios cursos oferecidos por plataformas como Dio, afiando e ampliando significativamente minhas habilidades.",text2:"Atualmente, meu foco  aprimorar minha proficincia em React Js e React Native. Este investimento contnuo em autoconhecimento e melhoria vai alm da aquisio de habilidades tcnicas. Trata-se de promover uma mentalidade resiliente e inovadora capaz de navegar e superar os desafios apresentados pelo cenrio profissional dinmico e em constante evoluo do qual fao parte."},MChiodi:{title:"Criao de MChiodi",text1:"Quando comecei meus estudos em React Native, no imaginava o impacto que isso teria na minha vida. Com dedicao e paixo pelo desenvolvimento, criei a MChiodi, uma conta de desenvolvedor que hoje conta com mais de 7 apps lanados, alm de um canal no YouTube com contedos voltados  programao!",text2:"Mas o mais incrvel dessa jornada no foi apenas construir aplicativos, e sim as oportunidades que surgiram. Atravs desse projeto, tive a honra de palestrar em algumas escolas, compartilhando minha experincia e incentivando alunos a acreditarem no poder do aprendizado e da tecnologia."}},uR={video1:{title:"De Programador a Criador de Contedo",description:"Neste vdeo, compartilho minha jornada de programador a criador de contedo. Falo sobre os desafios e aprendizados que enfrentei ao longo do caminho e como isso me ajudou a crescer profissionalmente. Se voc est pensando em seguir esse caminho, este vdeo  para voc!"},video2:{title:"Lynx: Uma Nova Ameaa ao React Native e Flutter?",description:"Neste vdeo, discutimos o Lynx, uma nova linguagem de programao que promete revolucionar o desenvolvimento de aplicativos mveis. Vamos explorar suas caractersticas, vantagens e como ela se compara ao React Native e Flutter. Se voc  desenvolvedor ou est interessado em tecnologia, no perca!"},video3:{title:"Voc No  Front-End de Verdade se No Conhece Essas 6 Bibliotecas!",description:"Neste vdeo, apresento 6 bibliotecas essenciais que todo desenvolvedor front-end deve conhecer. Cada uma delas traz funcionalidades incrveis que podem facilitar e agilizar o seu trabalho. Se voc quer se destacar na rea, no deixe de conferir!"}},cR={title:"Contedo Tech",text:"Aqui esto alguns vdeos e produes de contedo que publico no meu canal e redes sociais!",link:"Ver mais no canal "},dR={navbar:eR,footer:tR,about:nR,projects:rR,AllProjects:iR,ProjectCard:oR,Modal:sR,certificates:aR,experience:lR,youtubeVideos:uR,YoutubeSection:cR},fR={en:{translation:Zj},pt:{translation:dR}};st.use(qb).init({resources:fR,lng:"pt",fallbackLng:"en",interpolation:{escapeValue:!1}});yw.createRoot(document.getElementById("root")).render(C.jsx(T.StrictMode,{children:C.jsx(Cj,{})}));
